      out.write("    }else if (date.getFullYear()>today.getFullYear()){\r\n");
      out.write("        return 1;\r\n");
      out.write("    }else{\r\n");
      out.write("        if(date.getMonth()<today.getMonth()){\r\n");
      out.write("            return -1;\r\n");
      out.write("        }else if(date.getMonth()>today.getMonth()){\r\n");
      out.write("            return 1;\r\n");
      out.write("        }else{\r\n");
      out.write("            if(date.getDate()<today.getDate()){\r\n");
      out.write("                return -1;\r\n");
      out.write("            }else if(date.getDate()>today.getDate()){\r\n");
      out.write("                return  1;\r\n");
      out.write("            }\r\n");
      out.write("            else return 0;\r\n");
      out.write("        }\r\n");
      out.write("    }\r\n");
      out.write("}\r\n");
