      out.write("function ToShamsi1(grgYear,grgMonth,grgDay,Format){\r\n");
      out.write("    var hshYear = grgYear-621;\r\n");
      out.write("    var hshMonth,hshDay;\r\n");
      out.write("\r\n");
      out.write("    var grgLeap=grgIsLeap1 (grgYear);\r\n");
      out.write("    var hshLeap=hshIsLeap (hshYear-1);\r\n");
      out.write("\r\n");
      out.write("    var hshElapsed;\r\n");
      out.write("    var grgElapsed = grgSumOfDays[(grgLeap ? 1:0)][grgMonth-1]+grgDay;\r\n");
      out.write("\r\n");
      out.write("    var XmasToNorooz = (hshLeap && grgLeap) ? 80 : 79;\r\n");
      out.write("\r\n");
      out.write("    if (grgElapsed <= XmasToNorooz)\r\n");
      out.write("    {\r\n");
      out.write("        hshElapsed = grgElapsed+286;\r\n");
      out.write("        hshYear--;\r\n");
      out.write("        if (hshLeap && !grgLeap)\r\n");
      out.write("            hshElapsed++;\r\n");
      out.write("    }\r\n");
      out.write("    else\r\n");
      out.write("    {\r\n");
      out.write("        hshElapsed = grgElapsed - XmasToNorooz;\r\n");
      out.write("        hshLeap = hshIsLeap (hshYear);\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("    for (var i=1; i <= 12 ; i++)\r\n");
      out.write("    {\r\n");
      out.write("        if (hshSumOfDays [(hshLeap ? 1:0)][i] >= hshElapsed)\r\n");
      out.write("        {\r\n");
      out.write("            hshMonth = i;\r\n");
      out.write("            hshDay = hshElapsed - hshSumOfDays [(hshLeap ? 1:0)][i-1];\r\n");
      out.write("            break;\r\n");
      out.write("        }\r\n");
      out.write("    }\r\n");
      out.write("\r\n");
      out.write("\r\n");
      out.write("    if (Format==\"Long\")\r\n");
      out.write("        return hshDayName (hshDayOfWeek(hshYear,hshMonth,hshDay)) + \"  \" + hshDay + \" \" + calNames(\"hf\", hshMonth-1) + \" \" + hshYear;\r\n");
      out.write("    else\r\n");
      out.write("        return hshYear + \" /\" + hshMonth + \" /\" + hshDay;\r\n");
      out.write("}\r\n");
      out.write("function grgIsLeap1 (Year){\r\n");
      out.write("    return ((Year%4) == 0 && ((Year%100) != 0 || (Year%400) == 0));\r\n");
      out.write("}\r\n");
      out.write("function hshIsLeap (Year){\r\n");
      out.write("    Year = (Year - 474) % 128;\r\n");
      out.write("    Year = ((Year >= 30) ? 0 : 29) + Year;\r\n");
      out.write("    Year = Year - Math.floor(Year/33) - 1;\r\n");
      out.write("    return ((Year % 4) == 0);\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function hshDayOfWeek(hshYear, hshMonth, hshDay){\r\n");
      out.write("    var value;\r\n");
      out.write("    value = hshYear - 1376 + hshSumOfDays[0][hshMonth-1] + hshDay - 1;\r\n");
      out.write("    for (var i=1380; i<hshYear; i++){\r\n");
      out.write("        if (hshIsLeap(i)) value++;\r\n");
      out.write("    }\r\n");
      out.write("    for (var i=hshYear; i<1380; i++){\r\n");
      out.write("        if (hshIsLeap(i)) value--;\r\n");
      out.write("    }\r\n");
      out.write("    value=value%7;\r\n");
      out.write("    if (value<0) value=value+7;\r\n");
      out.write("    return (value);\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function hshDayName(DayOfWeek)\t{\r\n");
      out.write("    return calNames(\"df\", DayOfWeek%7);\r\n");
      out.write("}\r\n");
      out.write("\r\n");
      out.write("function calNames(calendarName, monthNo) {\r\n");
      out.write("    switch (calendarName)\r\n");
      out.write("    {\r\n");
      out.write("        case \"hf\": return Array(\"فروردين\", \"ارديبهشت\", \"خرداد\", \"تير\", \"مرداد\", \"شهريور\", \"مهر\", \"آبان\", \"آذر\", \"دی\", \"بهمن\", \"اسفند\")[monthNo];\r\n");
      out.write("        case \"ge\": return Array(\" January \", \" February \", \" March \", \" April \", \" May \", \" June \", \" July \", \" August \", \" September \", \" October \", \" November \", \" December \")[monthNo];\r\n");
      out.write("        case \"gf\": return Array(\"ژانویه\", \"فوریه\", \"مارس\", \"آوریل\", \"مه\", \"ژوثن\", \"ژوییه\", \"اوت\", \"سپتامبر\", \"اكتبر\", \"نوامبر\", \"دسامبر\")[monthNo];\r\n");
      out.write("        case \"df\": return Array(\"شنبه\", \"یک‌شنبه\", \"دوشنبه\", \"سه‌شنبه\", \"چهارشنبه\", \"پنج‌شنبه\", \"جمعه\")[monthNo];\r\n");
      out.write("        case \"de\": return Array(\"Saturday\", \"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\")[monthNo];\r\n");
      out.write("    }\r\n");
      out.write("}\r\n");
